import { 
  DashboardOutlined, HomeOutlined, WalletOutlined, TeamOutlined, DeploymentUnitOutlined
} from '@ant-design/icons';
import { APP_PREFIX_PATH } from 'configs/AppConfig'

const dashBoardNavTree = [{
  key: 'Wallet',
  path: `${APP_PREFIX_PATH}/wallet`,
  title: 'Wallet',
  icon: WalletOutlined,
  breadcrumb: false,
  submenu: []
},
  {
  key: 'userlist',
  path: `${APP_PREFIX_PATH}/userlist`,
  title: 'userlist',
  icon: TeamOutlined,
  breadcrumb: false,
  submenu: []
},						 
						 ]

const navigationConfig = [
  ...dashBoardNavTree
]

export default navigationConfig;
